// import { useState } from 'react';

export default function Button() {
    const [count, setCount] = useState(0);

    function handleClick() {
        setCount(count + 1);
    }

    function handler() {
        setCount(count + 1);
    }

    return (
        <button onClick={handler}>
            Clicked {count} times
        </button>
    );
}
